import React from "react";
import BackButton from "./Buttons/BackButton";
import Zoom from "@material-ui/core/Zoom";
import UpButton from "./Buttons/UpButton";
import { MainDiv, StyledPaper, ItalicText} from "./styles/ContentPages";

import styled from "styled-components";
import Paper from "@material-ui/core/Paper";

const GreenHyperlink = styled.a`
  color: #6e7c5e;
`;

const GreenPaper = styled(Paper)`
  width: 90%;
  margin-top: 3em;
  background-color: #eaede7;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  margin-bottom: 1em;
`;

const TextDiv = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`;
export const ProjectTitle = styled.h1`
  color: #000000;
  font-weight: 400;
  font-size: 4em;
  text-align: center;

  margin: 0em;
  @media (max-width: 768px) {
    font-size: 3em;
  }
`;

const ProjectImg = styled.img`
  height: 32vh;
  width: 48vh;
  border-radius: 2%;
  margin-bottom: 1em;

  @media (max-width: 768px) {
    height: 20vh;
    width: 30vh;
  }
`;

export const ProjectText = styled.p`
  color: #353336;
  font-size: 2em;

  font-weight: 300;
  margin: 1em;
  @media (max-width: 768px) {
    font-size: 1em;
  }
`;

export default function Bio(props) {
  return (
    <MainDiv>
      <BackButton onClick={() => props.transition("MENU")} />
      <Zoom in={true}>
        <StyledPaper>
          <GreenPaper elevation={12}>
            <TextDiv>
              <ProjectTitle>SETTLE</ProjectTitle>
              <ItalicText>links here</ItalicText>
              <ProjectText>
                Settle is a single page, responsive React application built with
                a Ruby on Rails API back-end. A wellness application, Settle
                aims to help secondary-students manage and cope with the
                symptoms of Test Anxiety. Settle introduces teens to the
                practice of mindfulness, while also empowering them with the
                tools and knowledge they need to modify the dysfunctional
                patterns of thinking associated with anxiety. User activity is
                also saved and analyzed in order track/display progress.<br/>
                TECH STACK: 
              </ProjectText>
            </TextDiv>
            <ProjectImg
              alt="settle"
              src="https://res.cloudinary.com/dpfixnpii/image/upload/v1583451000/Screen_Shot_2020-03-05_at_6.29.19_PM_tnhxeo.png"
            />
          </GreenPaper>
          <ItalicText>
            The git repository for this website can be found{" "}
            <GreenHyperlink
              href="https://github.com/janeszelag/resumesite"
              target="_blank"
              rel="noopener noreferrer"
            >
              here.
            </GreenHyperlink>
          </ItalicText>
          <UpButton onClick={() => props.scrollUp()} />
        </StyledPaper>
      </Zoom>
    </MainDiv>
  );
}
